import React from "react";
import CartWidget from "./CartWidget";
import Imagen from "../imagen/header.png";
const NavBar= () =>{
    return(
        <nav>
            <div></div>
            <img src={Imagen} className="imagen"/>
            <ul>
                <li>Inicio</li>
                <li>Contactofs</li>
                <li>Catalogo</li>
            </ul>
        <CartWidget/>
        </nav>
    )
}
export default NavBar;
